package listaI;

/*Desenvolva um programa para apresentar os resultados da tabuada do número 5 no seguinte
		layout: “5 x “ N “ = “ 5*N
*/

//LAURA XAVIER CHAGAS

public class I3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for(int m=1;m<=10;m++){
			
			System.out.println("5 X "+ m + " = "+ 5*m+"\n");
	      
	    }
	     }
	

}
